import './Post.css'

function Post(post) {
    const deletePost = () => {
        console.log(post.filter((item) => item.post !== item.post.id))
        //
    }

    return (
        <li className="post">
            <span>User id: {post.post.userId}</span>
            <h2>{post.post.title}</h2>
            <p>{post.post.body}</p>
            <span>Post id: {post.post.id}</span>
            <button className="post-button-delete" onClick={deletePost}>
                Delete this is post
            </button>
        </li>
    )
}

export default Post
